import React from 'react';
import { Button } from "@microsoft/fast-components-react-msft";
import { Column, Grid } from "@microsoft/fast-layouts-react";
import { info } from "../data/info";


export default  function InfoChanger(i, onClickDecrease, onClickIncrease){

    console.log(onClickIncrease);
    console.log(onClickDecrease);


    return (
        <Grid>


        <Column>
            <Button onClick={onClickIncrease}>
                {console.log("this is i" + i.i >= 2 ? 0 : i.i + 1)}
                {info.sections[1].headingText}
            </Button>
        </Column>


        <Column>
            <Button onClick={onClickDecrease}>
                {console.log(i <= 0 ? 2 : i - 1)}
                {info.sections[0].headingText}
            </Button>
        </Column>

        </Grid>
    )
};
